import React, { useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Box,
  Alert,
  CircularProgress
} from '@mui/material';

const AddUserDialog = ({ open, onClose, onUserAdded }) => {
  const [newUser, setNewUser] = useState({
    name: '',
    email: '',
    password: '',
    role: 'student',
    department: 'Computer Science'
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (field) => (e) => {
    setNewUser({ ...newUser, [field]: e.target.value });
    setError(''); // Clear error when user starts typing
  };

  const handleAddUser = async () => {
    // Validation
    if (!newUser.name || !newUser.email || !newUser.password) {
      setError('Please fill in all required fields');
      return;
    }

    if (!newUser.email.includes('@')) {
      setError('Please enter a valid email address');
      return;
    }

    setLoading(true);
    setError('');

    try {
      // Use the apiService from parent component through the callback
      const userData = {
        name: newUser.name,
        email: newUser.email,
        password: newUser.password,
        role: newUser.role,
        department: newUser.department,
        phone: '', // Add default values for required fields
        semester: newUser.role === 'student' ? 1 : undefined
      };

      // Call the parent component's function to handle the API call
      const result = await onUserAdded(userData);

      // Reset form and close dialog
      setNewUser({
        name: '',
        email: '',
        password: '',
        role: 'student',
        department: 'Computer Science'
      });
      setError('');
      onClose();

    } catch (error) {
      console.error('Error adding user:', error);
      setError(error.message || 'Failed to add user. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleClose = () => {
    setNewUser({
      name: '',
      email: '',
      password: '',
      role: 'student',
      department: 'Computer Science'
    });
    setError('');
    setLoading(false);
    onClose();
  };

  return (
    <Dialog open={open} onClose={handleClose} maxWidth="sm" fullWidth>
      <DialogTitle>Add New User</DialogTitle>
      <DialogContent>
        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        <Box sx={{ pt: 1 }}>
          <TextField
            fullWidth
            label="Full Name *"
            margin="normal"
            value={newUser.name}
            onChange={handleInputChange('name')}
            disabled={loading}
          />

          <TextField
            fullWidth
            label="Email *"
            margin="normal"
            type="email"
            value={newUser.email}
            onChange={handleInputChange('email')}
            disabled={loading}
          />

          <TextField
            fullWidth
            label="Password *"
            margin="normal"
            type="password"
            value={newUser.password}
            onChange={handleInputChange('password')}
            disabled={loading}
          />

          <FormControl fullWidth margin="normal" disabled={loading}>
            <InputLabel>Role *</InputLabel>
            <Select
              value={newUser.role}
              label="Role *"
              onChange={handleInputChange('role')}
            >
              <MenuItem value="student">Student</MenuItem>
              <MenuItem value="faculty">Faculty</MenuItem>
              <MenuItem value="admin">Admin</MenuItem>
            </Select>
          </FormControl>

          <TextField
            fullWidth
            label="Department"
            margin="normal"
            value={newUser.department}
            onChange={handleInputChange('department')}
            disabled={loading}
            placeholder="e.g., Computer Science, Mathematics"
          />
        </Box>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} disabled={loading}>
          Cancel
        </Button>
        <Button 
          variant="contained" 
          onClick={handleAddUser}
          disabled={loading}
          startIcon={loading ? <CircularProgress size={20} /> : null}
        >
          {loading ? 'Adding...' : 'Add User'}
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default AddUserDialog;
